// ProjectPage.js
import React from 'react';
import { Link, useNavigate } from 'react-router-dom';


function ProjectPage({ project }) {
const roundClassName = `project-type-single ${project.type === 'design' ? 'design' : 'dev'}`;

  return (
    <div className="project-page">
        <div class="project-tile-single">
            {/* <img src={project.image} alt={project.title} /> */}
        </div>
        <div className="project-tile-text">
            <h3 className="project-title">{project.title}</h3>
            <h4>{project.stack}</h4>
            <p className="project-desc">{project.description}</p>
            <a className="green" href={project.link}>View Project</a>
        </div>
        <Link to="/dev">Back to Projects</Link>
        <div className="round"><h2 className="project-type-single">{project.type}</h2></div>
    </div>
  );
}

export default ProjectPage;
